@prefix : <http://www.example.com#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:ATM rdf:type owl:Class.
:UserTransaction rdf:type owl:Class.
:CardInsertion rdf:type owl:Class.

:logs rdf:type owl:ObjectProperty;
    rdfs:domain :ATM;
    rdfs:range :UserTransaction.

:after rdf:type owl:ObjectProperty;
    rdfs:domain :CardInsertion;
    rdfs:range :UserTransaction.

:UserTransaction owl:equivalentClass [
    rdf:type owl:Restriction;
    owl:onProperty :after;
    owl:someValuesFrom :CardInsertion;
].

:ATM owl:equivalentClass [
    rdf:type owl:Restriction;
    owl:onProperty :logs;
    owl:someValuesFrom :UserTransaction;
].
